===Noun===
{{en-noun}}
{{wikipedia|Yarn over}}
# {{lb|en|knitting}} A [[technique]] in which the [[yarn]] is passed over the right-hand [[needle]]. In general, the new loop is knitted on the next row, either by itself (producing a hole) or together with an adjacent [[stitch]].
